import React,{useEffect} from "react";
// import ImageCard from "../ImageCard/ImageCard";
import { useDispatch, useSelector } from "react-redux";
import {getAllImages, fetchAsyncImages} from "../../features/Images/imageSlice";
import { Link } from "react-router-dom";
import './Tree.css';

const Tree = () => {
    const dispatch = useDispatch();
    useEffect(()=>{
        dispatch(fetchAsyncImages("festivals"));
    },[dispatch]);

    const images = useSelector(getAllImages);
    let renderImages= "";

    renderImages = images.hits.length>1? (
        images.hits.map((image, index) => {
            <div className="card-item">
              <Link to={`/image/${image.id}`}>
                <div className="card-inner">
                  <div className="card-top">
                    <img src={image.largeImageURL}  alt={image.tags}/>
                  </div>
                </div>
              </Link>
            </div>
        // <ImageCard key={index} data={image} />
        }) ): (
      <div> <h3>{images.Error}</h3></div>
    );

    return (
        <div className="conatiner">
            <div className="image-container">{renderImages}</div>
        </div>
    );
};

export default Tree;
